import React from "react";
import * as THREE from "three";
import { Canvas } from "@react-three/fiber";

function App() {
  return (
    <div>
      <h1>Three.js 다뤄보기</h1>
      <Canvas>
        <mesh>
          <boxBufferGeometry />
          <meshPhongMaterial />
        </mesh>
        <ambientLight args={[0xff0000]} intensity={0.1} />
        <directionalLight position={[0, 0, 5]} intensity={0.5} />
      </Canvas>
    </div>
  );
}

export default App;
